import React from 'react'
import GptSearchBar from './GptSearchBar'
import GptMovieSuggestions from './GptMovieSuggestions'

const GPTSearch = () => {
  return (
    <div>
      <GptSearchBar/>
      <GptMovieSuggestions />
    </div>
  )
}

export default GPTSearch
